import React, { Component } from 'react'

class Landing extends Component {
    constructor() {
        super()
        this.state = {
            email: '',
            password: '',
        }
    }



    render() {
        let {
            state: {
                email,
                password,
            },
        } = this

        return (
            <form>
                <h2>Landing page</h2>
            </form>
        )
    }
}


export default Landing
